import React from "react";
import axios from "axios";

export const Home = () => {
  let contentName = window.location.pathname;

  axios.get(`${process.env.PUBLIC_URL}/${contentName}`)
  .then(response => {
    response.forEach(element => {
      console.log(element.name)
    });
  })
  return <h1>Home</h1>;
};
